import styled from "styled-components";

const MyPageComp = styled.div`
  width: 100%;
  margin-top: 150px;
  .mypage_inner {
    width: 80%;
    margin: 0 auto;
    display: flex;
    padding: 40px 0;
    gap: 20px;
    .side_menu {
      width: 300px;
      height: 600px;
      border: 1px solid #000;
    }
    .main_container {
      width: 100%;
      border: 1px solid #000;
    }
  }
`;
export default MyPageComp;
